        private static AchievementType ResolveAchievementType(Game game, string typeStr)
        {
            if (string.IsNullOrEmpty(typeStr) || game == null) return AchievementType.NONE;

            Infos infos = game.infos();
            int count = (int)infos.achievementsNum();

            for (int i = 0; i < count; i++)
            {
                var type = (AchievementType)i;
                var info = infos.achievement(type);
                if (info != null && info.mzType.Equals(typeStr, StringComparison.OrdinalIgnoreCase))
                    return type;
            }

            return AchievementType.NONE;
        }

