        private static CommandResult ExecuteVictoryTeam(object clientManager, Game game, GameCommand cmd, CommandResult result)
        {
            if (!TryGetStringParam(cmd, "victory_type", out var eVictoryResult))
            {
                result.Error = GetParamError("victory_type", eVictoryResult, "string");
                return result;
            }
            if (!TryGetStringParam(cmd, "team_type", out var eTeamResult))
            {
                result.Error = GetParamError("team_type", eTeamResult, "string");
                return result;
            }
            if (!TryGetStringParam(cmd, "action", out var actionResult))
            {
                result.Error = GetParamError("action", actionResult, "string");
                return result;
            }

            if (_sendVictoryTeamMethod == null)
            {
                result.Error = "victoryTeam command not available";
                return result;
            }

            try
            {
                VictoryType eVictory = ResolveVictoryType(game, eVictoryResult.Value);
                if (eVictory == VictoryType.NONE)
                {
                    result.Error = $"Unknown VictoryType: {eVictoryResult.Value}";
                    return result;
                }
                TeamType eTeam = ResolveTeamType(eTeamResult.Value);
                if (eTeam == TeamType.NONE)
                {
                    result.Error = $"Unknown TeamType: {eTeamResult.Value}";
                    return result;
                }
                ActionType action = ResolveActionType(actionResult.Value);

                _sendVictoryTeamMethod.Invoke(clientManager, new object[] { eVictory, eTeam, action });
                result.Success = true;
            }
            catch (Exception ex)
            {
                result.Error = $"victoryTeam failed: {ex.InnerException?.Message ?? ex.Message}";
            }

            return result;
        }

        private static CommandResult ExecuteWake(object clientManager, Game game, GameCommand cmd, CommandResult result)
        {
            if (!TryGetIntParam(cmd, "unit_id", out var pUnitResult))
            {
                result.Error = GetParamError("unit_id", pUnitResult, "integer");
                return result;
            }

            if (_sendWakeMethod == null)
            {
                result.Error = "wake command not available";
                return result;
            }

            try
            {
                Unit pUnit = game.unit(pUnitResult.Value);
                if (pUnit == null)
                {
                    result.Error = $"Unit not found: {pUnitResult.Value}";
                    return result;
                }

                _sendWakeMethod.Invoke(clientManager, new object[] { pUnit });
                result.Success = true;
            }
            catch (Exception ex)
            {
                result.Error = $"wake failed: {ex.InnerException?.Message ?? ex.Message}";
            }

            return result;
        }

        #endregion
    }
